import React from 'react';
import './Avatar.css';
import picture from './../../../../public/img/avatar.png'

class Avatar extends React.Component{
    render() {
        return (
            <div className={"avatar"}>
                <img src={picture} alt="Avatar"/>
            </div>
        )
    }
}

export default Avatar;
